  },
  data() {
    return {
      lastMainRoute: "",
      bindRoute: {
        AdminPanel: "Админ панель",
        PlayersList: "Список игроков",
        Player: "Игрок",
        PlayerInfo: "Инфо",
        Transport: "Транспорт",
        TransportSpawn: "Транспорт",
        TP: "Телепорт"
      }
    };
  },
  methods: {
    getBindedRoute(location, i) {
      const bindedRoute = this.bindRoute[location];
      return (bindedRoute || location) + `${i === this.pathHistory.length - 1 ? "" : " / "} `;
    },
    closeWindow() {
      this.$store.dispatch("adminPanel/selectNav", this.pathHistory[0]);
    }
  },
  computed: {
    navLocation() {
      const route = this.$route.fullPath;
      const listOfLocation = route.split("/");
      listOfLocation.shift();
      return listOfLocation;
    }
  }
};
